- input: "TEXT\x1CC00167346\x1CTEXT-00001\x1C\x1CF3XA\x1CThis amendment is in response
    to the Commission's request.    1.  The summary page totals are correct and will
    be supported with the amendment of a previous report.    2.  Receipts on Schedule
    A, Supporting Line 11(a)(i) from Congressional Committees we transfers and have
    now been labeled as such.    3.  The receipt on Schedule A, Supporting Line 17,
    from Catalist was for Voter File Access and was charged at the usual and normal
    charge.  In this instance, Catalist requested an updated copy of the voter file.
    \ We requested this file from the State and passed the cost on directly to Catalyst.
    \     4.  We have updated several addresses.  The remaining addresses missing
    from Schedule H6 and Schedule B, Supporting Line 30b, were for canvassers that
    we were unable to collect information on.  This data was requested before the
    canvass, but the consultants managing the canvass apparently were unable tot collect
    this information.  We have made a second attempt to collect this data, whithout
    any luck.    5.  The expense on Schedule B, supporting Line 30(b), for GOTV Mail
    Postage was for generic GOTV activity and did not mention a federal candidate,.
    \   6.  Transfers from the National committees were segregated in thier own account
    and were not used to fund exempt activity.    7.  The Communications Consultant
    on Scheduel H4 was not an employee of the Committee and did not spend over 25%
    of thier compensated time on Federal Activity.    8.  The voided checks on Schedule
    H4 were deducted from the next transfer.  Our software populates all H4 transactions
    in a special utility that calulates the total amount of each H3 transfer for us,
    based on the allocable transactions in the window.  When we void a check, it creates
    the negative entry on the same schedule and the software allows us to include
    that in the calculation.  Using this method, we have deducted the nonfederal portion
    out of the transfer amount, rather than creating a seperate transaction to move
    money back to the non federal account.      9.  All payroll related items on Schedule
    H4 we for employees that did not spend over 25% of thier compensated time on Federal
    Activity.  \n"
